import React from 'react';
import imagelogo from '../../imagelogo.png';

const Header = () => {
    return (
        <React.Fragment>
            <header className={HeaderCss.header}>
                <img src={imagelogo} alt="Картинка" height="150" />
                Header
            </header>
        </React.Fragment>
    );
}

export default Header;
